                            </div>
                        </div>
                        <div className={styles.model}>
                            <div className={styles.lineDot}></div>
                            <div className={styles.manuName}>厂商</div>
                            <div className={styles.manuList}>
                                <div>厂商11111111111</div>
                                <div>厂商22222222222</div>
                                <div>厂商33333333333</div>
                            </div>
                        </div>
